  [],\n\t\"num_tags\": 0,\n\t\"name\": \"mosaic-of-gridded-multibeam-bathymetry-and-bathymetry-derived-from-multispectral-ikonos-satelli38942\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Gridded multibeam bathymetry is integrated
  with bathymetry derived from multispectral IKONOS satellite data. Gridded (5 m cell
  size) multibeam bathymetry were collected aboard the R/V AHI (Acoustic Habitat Investigator).
  Bathymetry values shallower than 25 m were derived from multispectral IKONOS satellite
  image by analyzing the relative attenuation of blue and green spectral radiance
  as a function of depth. A multiple linear regression analysis of linearized blue
  and green band spectral values against multibeam depths determined the variables
  of y-intercept, blue slope and green slope values. Variables were then used in multivariate
  slope intercept formula to derive depth. Variables were adjusted to improve the
  statistical accuracy and spatial coverage of the final derived bathymetry product.
  Digital image processing to derive depths conducted with the ENVI 4.5 software program
  while data editing and integration was performed using ArcGIS 9.3. This dataset
  is for the bank and lagoon environment of Rose Atoll, American Samoa, USA.\",\n\t\"owner_org\":
